(2, 'РџСЂРµРґРїРѕРґРіРѕС‚РѕРІРєР°', 'РњРµС‚РѕРґ blink РІРѕР·РІСЂР°С‰Р°РµС‚ СЃС‚СЂРѕРєСѓ, СЃРѕСЃС‚РѕСЏС‰СѓСЋ РёР· РїСЂРёРјРёС‚РёРІРЅРѕРіРѕ Р·РЅР°С‡РµРЅРёСЏ СЃС‚СЂРѕРєРѕРІРѕРіРѕ РѕР±СЉРµРєС‚Р°, Р·Р°РєР»СЋС‡РµРЅРЅРѕРіРѕ РІ С‚РµРіРё <BLINK>вЂ¦</BLINK>. РџСЂРѕРІРµСЂРєРё РЅР° С‚Рѕ, РЅРµ Р±С‹Р»Р° Р»Рё РёСЃС…РѕРґРЅР°СЏ СЃС‚СЂРѕРєР° СѓР¶Рµ Р·Р°РєР»СЋС‡РµРЅР° РІ СЌС‚Рё С‚РµРіРё, РЅРµ РґРµР»Р°РµС‚СЃСЏ. Р­С‚РѕС‚ РјРµС‚РѕРґ РёСЃРїРѕР»СЊР·СѓРµС‚СЃСЏ СЃРѕРІРјРµСЃС‚РЅРѕ СЃ РјРµС‚РѕРґР°РјРё document.write Рё document.writeln РґР»СЏ РѕС‚РѕР±СЂР°Р¶РµРЅРёСЏ С‚РµРєСЃС‚Р° РјРёРіР°СЋС‰РёРј С€СЂРёС„С‚РѕРј. РЈРєР°Р·Р°РЅРЅС‹Рµ С‚РµРіРё РЅРµ РІС…РѕРґСЏС‚ РІ СЃС‚Р°РЅРґР°СЂС‚ HTML Рё РїРѕРґРґРµСЂР¶РёРІР°СЋС‚СЃСЏ С‚РѕР»СЊРєРѕ РѕР±РѕР·СЂРµРІР°С‚РµР»СЏРјРё Netscape Рё WebTV. РќР°РїСЂРёРјРµСЂ, РѕРїРµСЂР°С‚РѕСЂ document.write("РњРѕР№ С‚РµРєСЃС‚".blink()) РІС‹РІРµРґРµС‚ РЅР° СЌРєСЂР°РЅ РѕР±РѕР·СЂРµРІР°С‚РµР»СЏ СЃС‚СЂРѕРєСѓ РњРѕР№ С‚РµРєСЃС‚.'),
(3, 'Предподготовка', 'Метод blink возвращает строку, состоящую из примитивного значения строкового объекта, заключенного в теги <BLINK>…</BLINK>. Проверки на то, не была ли исходная строка уже заключена в эти теги, не делается. Этот метод используется совместно с методами document.write и document.writeln для отображения текста мигающим шрифтом. Указанные теги не входят в стандарт HTML и поддерживаются только обозревателями Netscape и WebTV. Например, оператор document.write("Мой текст".blink()) выведет на экран обозревателя строку Мой текст.'),
(4, 'Предподготовка', 'Метод blink возвращает строку, состоящую из примитивного значения строкового объекта, заключенного в теги <BLINK>…</BLINK>. Проверки на то, не была ли исходная строка уже заключена в эти теги, не делается. Этот метод используется совместно с методами document.write и document.writeln для отображения текста мигающим шрифтом. Указанные теги не входят в стандарт HTML и поддерживаются только обозревателями Netscape и WebTV. Например, оператор document.write("Мой текст".blink()) выведет на экран обозревателя строку Мой текст.');
